export default {
  SET_PRODUCTS(state, { data }) {
    state.Products = data;
  },

  SET_PRODUCTS_BY_CATEGORY(state, { categoryId, data }) {},

  CATEGORY_FOOD(state, { categoryId, data }) {
    switch (categoryId) {
      case 1:
        state.Products = data;
        break;

      default:
        state.Products = data;
        break;
    }
  },
};
